export default function videoReducer({ state = initialState }, action) {
   const data = action.payload;
   switch (action.type) {
      case "ADD_VIDEO":
         const state_temp = [...state, data];
         const found = state_temp.find((video) => video.channel === "Masew");
         return found;

      //  return [...state, data];
      default:
         return;
   }
}
